    <div>
        <Pie
        data={{
          labels: ekonomikuriMomsaxurebisSaxeebi,
          datasets: [
            {
              label:"პროდუქციაზე მოთხოვნის ცვლილების გავლენა მთლიან ეკონომიკაზე",
              data: props.thirdDiagramValues1,
              backgroundColor: ["#37B067","#6296BC","#EDB40D","#7FD7C1","#9F8CAE","#366C72","#BCC7EE"],
            },
          ],
        }}
        height={"500"}
        options={{
          indexAxis: "y",
          maintainAspectRatio: false,
          scales: {
            y: {
              ticks: {
                font: {
                  size: 8,
                },
              },
            },
            x: {
              ticks: {
                font: {
                  size: 8,
                },
              },
            },
          },
        }}
      />

    </div>
  );
}

export default PieChart;
